import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (div with class 'cart') and click it to open the Shopping Cart Modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for the cart modal to appear (div#cartModal with style display: block or visible content)
    // Try both id and class selectors for robustness
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot after opening cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract cart modal visibility and title for verification
    const cartModalVisible = await page.evaluate(() => {
      const modal = document.getElementById('cartModal');
      if (!modal) return false;
      const style = window.getComputedStyle(modal);
      return style.display !== 'none' && style.visibility !== 'hidden' && modal.offsetParent !== null;
    });

    const cartModalTitle = await page.evaluate(() => {
      const modal = document.getElementById('cartModal');
      if (!modal) return null;
      const h2 = modal.querySelector('.cart-content h2');
      return h2 ? h2.textContent.trim() : null;
    });

    return {
      success: true,
      action: "Opened the Shopping Cart Modal by clicking the cart icon and verified modal visibility.",
      extractedData: {
        cartModalVisible,
        cartModalTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
